import { NavLink } from 'react-router-dom';

export default function Navigation() {
    return (
        <nav className='navbar navbar-expand-lg navbar-dark ' fill variant="tabs" defaultActiveKey="/home">
            <div>
                <img src="./logo192.png" alt="oh no!" width='30' height ='30'></img>
            </div>
                <NavLink className='' href="/home">Active</NavLink>
                <NavLink eventKey="link-1">Loooonger NavLink</NavLink>
                <NavLink eventKey="link-2">Link</NavLink>
                <NavLink eventKey="disabled" disabled>
                Disabled
                </NavLink>
        </nav>
    );
};
